国産にこだわったポーチです。バッグインバッグとしても使用できます。財布・通帳等の貴重品入れに!旅先での貴重品入れにもピッタリ!一つあれば大変役立つポーチです。革だからメンズにもレディースにも使えます!マチ部分もしっかりしているから長く使えること間違いなし!<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">国産にこだわったポーチです。バッグインバッグとしても使用できます。財布・通帳等の貴重品入れに!旅先での貴重品入れにもピッタリ!一つあれば大変役立つポーチです。革だからメンズにもレディースにも使えます!マチ部分もしっかりしているから長く使えること間違いなし!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">12×22.5×5.5cm</font><br><font color="#333333" size="-1">個装サイズ：13×23×6cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">135g</font><br><font color="#333333" size="-1">個装重量：145g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">牛革</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">ファスナー付</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
